class UserStory:
    def __init__(self, user_type, feature, reason):
        self.user_type = user_type
        self.feature = feature
        self.reason = reason


class UserStoryManager:
    def __init__(self):
        self.stories = []

    def add_story(self, user_type, feature, reason):
        story = UserStory(user_type, feature, reason)
        self.stories.append(story)

    def process_stories(self):
        for story in self.stories:
            print(f"{story.user_type} wants {story.feature} because {story.reason}")


class ValidationHandler:
    def validate_duns(self, action_type, duns_status):
        if action_type in ['B', 'C', 'D'] and duns_status == 'registered':
            return True
        return False

    def validate_fabs_submission(self, submission):
        if submission['status'] == 'published':
            return False
        return True


class FileHandler:
    def upload_file(self, file):
        if not file.endswith('.csv'):
            return "Error: Invalid file extension."
        # Process file upload logic here
        return "File uploaded successfully."

    def download_file(self, file_id):
        # Logic to download the file based on file_id
        return f"File {file_id} downloaded."


class User:
    def __init__(self, user_type):
        self.user_type = user_type

    def submit_data(self, data):
        # Logic for submitting data based on user type
        return f"{self.user_type} submitted data: {data}"


class Developer(User):
    def __init__(self):
        super().__init__('Developer')

    def log_errors(self, error_message):
        print(f"Log: {error_message}")

    def update_submission_status(self, submission, new_status):
        submission['status'] = new_status
        print(f"Submission status updated to {new_status}.")


class AgencyUser(User):
    def __init__(self):
        super().__init__('Agency User')

    def check_submission_periods(self):
        # Logic to check submission periods
        return "Submission periods are active."

    def derive_data_elements(self, data):
        # Logic to derive data elements
        return {key: value for key, value in data.items()}


class UIUser(User):
    def __init__(self):
        super().__init__('UI Designer')

    def request_user_testing(self):
        return "User testing scheduled for approval."


